import UpdateServices from './services/UpdateServices';
import { checkAdmin } from '../../api/admin';
// import { AdminContext } from '../../App';

const Admin = () => {

    const [isAdmin, setAdmin] = useState()

    const CheckAdmin = checkAdmin(localStorage.getItem("token"));

    CheckAdmin.then((result) => {
      console.log(result)
        // setAdmin(result)
    })

      if (isAdmin) {
        if (isAdmin === true) {
            return (
                <div>
                    <UpdateServices/>
                    <CreateServices/>
                </div>
            )
        }
      }
      if (isAdmin === false) {
        return <Navigate to="/"/>;
      }

};
export default Admin;
